(400, 'b4206492-1778-4860-8e24-af93296a37d4', 'facebook', '273353962530057', '2479778642411729', '120235838811190028', '120235838811220028', '120235838811200028', '1970420333776235', 'carousel', '\"[{\\\"title\\\":\\\"Tired of Fluid Limits & Fatigue? Explore a Clinical Trial.\\\",\\\"body\\\":\\\"If heart/kidney issues affect your daily life, join our local study. Receive advanced monitoring & potentially help develop new approaches to:\\\\n Reduce swelling & shortness of breath\\\\n Support kidney-heart connection\\\\n Improve energy levels\\\\n Mobile Unit Convenience | Compensation Provided\\\",\\\"image_url\\\":null,\\\"call_to_action\\\":\\\"APPLY_NOW\\\"},{\\\"title\\\":\\\" Break the Hospital Cycle? Research New Options Nearby.\\\",\\\"body\\\":\\\"Few trials study HF with kidney impairment  yet this combo affects millions. Help pioneer solutions by joining our FDA-monitored study:\\\\n Free comprehensive labs (eGFR, BNP, etc.)\\\\n Mobile unit reduces your stress\\\\n Compensation for time/travel\\\\n Be part of the medical breakthrough you need.\\\",\\\"image_url\\\":null,\\\"call_to_action\\\":\\\"APPLY_NOW\\\"},{\\\"title\\\":\\\"Finally, a Trial That Understood My Dual Struggle.  Michael R., Participant\\\",\\\"body\\\":\\\"Managing heart and kidney health felt overwhelming. AIREs team made it simple  they came to me. Join others like Michael in research that prioritizes:\\\\n Heart-kidney interaction science\\\\n At-home lab visits\\\\n Respect for your fatigue\\\\n Limited spots  See if you qualify today.\\\",\\\"image_url\\\":null,\\\"call_to_action\\\":\\\"APPLY_NOW\\\"},{\\\"title\\\":\\\" Critical Research Gap: Heart Failure + Kidney Patients Needed!\\\",\\\"body\\\":\\\"HF + kidney patients: Reduce ER visits? Our clinical trial studies interventions to stabilize both organs. Participate with AIREs mobile medical unit:\\\\n Expert cardiac/kidney oversight\\\\n Personalized care in your community\\\\n No insurance needed\\\\n Your participation could change care standards.\\\",\\\"image_url\\\":null,\\\"call_to_action\\\":\\\"APPLY_NOW\\\"},{\\\"title\\\":\\\"Get Paid for Heart Trial\\\",\\\"body\\\":\\\"Struggling to catch your breath? Tired all the time? \\\\nYou may be eligible for a heart failure clinical trial and earn up to $1650! Plus, get:\\\\n No-cost doctor care\\\\n Free study medication\\\\n Help shape future treatments\\\\n\\\\nSee if you qualify now!\\\",\\\"image_url\\\":null,\\\"call_to_action\\\":\\\"APPLY_NOW\\\"},{\\\"title\\\":\\\"Heart Failure: Get Compensated\\\",\\\"body\\\":\\\"Heart Failure? You May Be Eligible for a $1650 Clinical Trial!\\\\n\\\\nDo you experience shortness of breath, fatigue or swelling?\\\\nGet no-cost study-related care from local heart doctors\\\\nReceive no-cost study medication \\\\nHelp advance future treatments and earn up to $1650!\\\\nSee if you qualify now!\\\",\\\"image_url\\\":null,\\\"call_to_action\\\":\\\"APPLY_NOW\\\"},{\\\"title\\\":\\\"Heart Failure? Get Compensated\\\",\\\"body\\\":\\\"Heart Failure? You May Be Eligible for a $1650 Clinical Trial!\\\\n\\\\nExperiencing shortness of breath, fatigue or swelling?\\\\nYou could receive:\\\\n No-cost care from local heart doctors\\\\n Free study medication\\\\n Help advance future treatments\\\\n\\\\nSee if you qualify today and earn up to $1650!\\\",\\\"image_url\\\":null,\\\"call_to_action\\\":\\\"APPLY_NOW\\\"},{\\\"title\\\":\\\"Get Paid for Clinical Trial\\\",\\\"body\\\":\\\"Struggling to breathe, feeling exhausted or swollen? You may be eligible for a heart failure clinical trial and earn up to $1650! \\\\n\\\\nAs a participant, you\'ll receive:\\\\n Free care from local experts\\\\n Free study medication\\\\n The chance to help shape future treatments\\\\n\\\\nSee if you qualify now and take the first step towards a healthier tomorrow.\\\",\\\"image_url\\\":null,\\\"call_to_action\\\":\\\"APPLY_NOW\\\"},{\\\"title\\\":\\\"$1650 Heart Failure Study\\\",\\\"body\\\":\\\"Heart Failure Sufferer? \\\\nGet up to $1650 for participating in a clinical trial! If you experience shortness of breath, fatigue or swelling, you may qualify.\\\\nPlus:\\\\n Free care from local heart doctors\\\\n Free study medication\\\\nHelp advance future treatments & earn cash today!\\\",\\\"image_url\\\":null,\\\"call_to_action\\\":\\\"APPLY_NOW\\\"},{\\\"title\\\":\\\"No-cost study-related care from doctors\\\",\\\"body\\\":\\\"1. Get Expert Care: Receive no-cost study-related care from local heart doctors.\\\\n2. Save Money: All study medication is provided at no cost. Health insurance is not required.\\\\n3. Get Compensated: Qualifying participants may receive up to $1650 for their time.\\\\nIf you have heart failure, this clinical trial provides a unique opportunity to take an active role in your health. See if you qualify.\\\",\\\"image_url\\\":null,\\\"call_to_action\\\":\\\"APPLY_NOW\\\"},{\\\"title\\\":\\\"Diagnosed with chronic heart failure?\\\",\\\"body\\\":\\\"Were you diagnosed with chronic heart failure at least 3 months ago? If you live with symptoms like shortness of breath with activity or swelling in the legs, ankles, and feet, you may qualify for a local research study.\\\\n\\\\nThis trial offers:\\\\n No-cost study-related care from doctors\\\\n No-cost study medication\\\\n Compensation up to $1650\\\\n\\\\nHealth insurance is not required. Click to learn more and apply.\\\",\\\"image_url\\\":null,\\\"call_to_action\\\":\\\"APPLY_NOW\\\"},{\\\"title\\\":\\\"Living with heart failure? Join our local heart failure clinical trial.\\\",\\\"body\\\":\\\"Adults with heart failure are needed for an important clinical trial. Researchers need volunteers from different backgrounds to help advance heart health research.\\\\n\\\\nIn thanks for your participation, you could receive:\\\\n No-cost care from dedicated local doctors\\\\n No-cost study medication\\\\n Payment up to $1650\\\\n\\\\nMake a meaningful impact. See if you\'re eligible to join.\\\",\\\"image_url\\\":null,\\\"call_to_action\\\":\\\"APPLY_NOW\\\"},{\\\"title\\\":\\\"New heart failure clinical trial\\\",\\\"body\\\":\\\"Are you or a loved one being treated for heart failure? This new clinical trial provides an opportunity to receive no-cost study-related care from local doctors and no-cost study medication.\\\\n\\\\nParticipants also may receive compensation for their time. If you experience symptoms like a reduced ability to exercise, rapid heartbeat, or swelling, see if you qualify.\\\",\\\"image_url\\\":null,\\\"call_to_action\\\":\\\"APPLY_NOW\\\"},{\\\"title\\\":\\\" Payment up to $1650\\\",\\\"body\\\":\\\"Qualifying participants may receive up to $1650 for a heart failure clinical trial. If you experience symptoms like shortness of breath, fatigue, or swelling, you may be eligible.\\\\n\\\\nYou\'ll also receive:\\\\n No-cost study-related care from local heart doctors\\\\n No-cost study medication\\\\n The satisfaction of helping advance future treatments\\\\n\\\\nSee if you qualify for this compensated study today.\\\",\\\"image_url\\\":null,\\\"call_to_action\\\":\\\"APPLY_NOW\\\"}]\"', NULL, NULL, NULL, '\"APPLY_NOW\"', NULL, '2025-11-05 11:28:57', '2025-11-05 11:30:25'),
