(5147, 't_3910484659264407', 'm_oY45DhaD4yauT1y9Num4cRhzQSVLdgqqtafs2aaIipuTUVrNGpzsBZj2H8qO2GNivdMJo_bMNVhfkpLqR_Gx2A', 'visitor', 'How do I setup Instagram shopping?', 'text', 'yes', '2025-11-04T12:58:24.935Z', '2025-11-04 12:58:27', '2025-11-04 12:58:27'),
(5148, 't_3910484659264407', 'm_pN9uF0aAGZQUmycIABnBfRhzQSVLdgqqtafs2aaIipttYzhHIrYdqXdeluvpovZmOCN_u9sNkYc1xyY37U17-A', 'page', 'To set up Instagram shopping, first, you need to connect your WooCommerce store to Meta (Facebook & Instagram Shop) by installing the \"Facebook for WooCommerce\" plugin. Then, connect your Facebook account, select your Business Manager, and create or sync your Meta Product Catalog. After these steps, ensure your Instagram Business Profile meets the eligibility requirements and submit it for review to enable Instagram Shopping Tags.', 'text', 'yes', '2025-11-04T12:58:39.146+0000', '2025-11-04 12:58:39', '2025-11-04 12:58:39'),
(5149, 't_3910484659264407', 'm_T--80dAIbZi6-DHdLXqdZhhzQSVLdgqqtafs2aaIipuDi8YAgomfIqIzKo_VjTTYTvVGJE1PnsBxsJxSdO1_kQ', 'visitor', 'How to fix social login errors?', 'text', 'yes', '2025-11-04T12:59:51.793Z', '2025-11-04 12:59:54', '2025-11-04 12:59:54'),
