(572, 'e5266555-8859-4f96-bab0-6596b9736d94', 'eRLsKrw_6N', '75609893', ' Happy Dussehra! \r\n\r\nToday, we celebrate Dussehra, also known as Vijayadashami, a festival that marks the victory of good over evil, light over darkness, and truth over falsehood. \r\n\r\nThis day commemorates Lord Rama\'s victory over Ravana, symbolizing that no matter how powerful evil seems, truth and righteousness will always prevail. \r\n\r\nAcross India, vibrant celebrations unfold:\r\n Ramlila performances bringing the Ramayana to life,\r\n Effigies of Ravana, Meghnad, and Kumbhkaran set ablaze to signify the burning away of negativity,\r\n Families and communities coming together to celebrate unity and hope.\r\n\r\nAs we witness the flames rise high, lets also burn the Ravana within us  anger, ego, hatred, and greed  and welcome a life filled with kindness, humility, and compassion. \r\n\r\nDussehra reminds us that every challenge can be overcome with courage, faith, and perseverance.\r\nLet this day inspire you to take a step toward victory in your own life, whether personal or professional. \r\n\r\n What negativity are you ready to let go of this Dussehra? Share with us below!\r\n\r\n#HappyDussehra #Vijayadashami #GoodOverEvil #FestivalOfFaith #Positivity #Ramlila #DussehraCelebration', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQErk_8yPkJHDQ/feedshare-shrink_800/B56ZmjY1oKHQAk-/0/1759382822589?e=1762992000&v=beta&t=zK579tv99Rsmv10stnITsXkC_Yzt8qWfQwCLJD_puhM', 'urn:li:share:7379386415601676288', 'linkedin', 'API', '3c619eb7-b9fe-40f9-94fa-a287c4346c7a', 4, 0, 0, 0.5166666666666666, '55', '29', '2025-10-02', '1', '2025-10-09 09:52:56', '2025-10-22 09:26:21'),
(573, 'e5266555-8859-4f96-bab0-6596b9736d94', 'eRLsKrw_6N', '75609893', ' Navratri 2025 Concludes with Gratitude \r\n\r\nAs these nine sacred nights come to a close, lets reflect on the divine blessings and lessons Maa Durga has bestowed upon us. \r\n\r\nMay the spirit of courage, devotion, and positivity guide us every day, helping us overcome challenges and embrace new beginnings. \r\n\r\n What was your most special Navratri moment this year? Share with us in the comments!\r\n\r\n#Navratri2025 #MaaDurgaBlessings #Gratitude #FestivalOfFaith #GoodOverEvil #SpiritualJourney #Positivity', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQFj9gv260MU1w/feedshare-shrink_1280/B56Zmerpz1IYAs-/0/1759303868687?e=1762992000&v=beta&t=ZBPyB49j-G91clM-Y5Dps7yTWpUzffOVJ9ptevCSnQY', 'urn:li:share:7379055255671640064', 'linkedin', 'API', 'ab5b27f3-93bf-48ce-826d-b95d210d7c41', 5, 0, 0, 0.5905797101449275, '54', '23', '2025-10-01', '1', '2025-10-09 09:52:56', '2025-10-22 09:26:22'),
(574, 'e5266555-8859-4f96-bab0-6596b9736d94', 'eRLsKrw_6N', '75609893', ' Navratri Day 9  Celebrating Maa Siddhidatri \r\n\r\nOn the final day of Navratri, we bow to Maa Siddhidatri, the divine mother who blesses her devotees with spiritual wisdom and fulfillment. \r\n\r\nMay her grace remove ignorance and fill your life with clarity, peace, and prosperity. \r\n\r\n Offer fruits, sesame seeds, and sweets today to seek her divine blessings.\r\n\r\n Mantra: Om Devi Siddhidatryai Namah\r\n\r\n As Navratri concludes, may we carry forward the values of strength, faith, and devotion into our lives each day. \r\n\r\n#Navratri2025 #Day9 #MaaSiddhidatri #SpiritualGrowth #PeaceAndProsperity #FestivalOfFaith #NavratriVibes', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQHgqb3ZRsvAYA/feedshare-shrink_800/B56ZmeNpwoIAAg-/0/1759296004433?e=1762992000&v=beta&t=EaajXGGL4oWoI4UPtjdTn-PUkdSz_pJw2dLzHu-ZvOg', 'urn:li:share:7379022280321970176', 'linkedin', 'API', 'c3c7ebba-be9d-40ef-b3bf-d522458e50c9', 12, 1, 0, 1.7303921568627452, '40', '19', '2025-10-01', '1', '2025-10-09 09:52:56', '2025-10-22 09:26:23'),
(575, 'e5266555-8859-4f96-bab0-6596b9736d94', 'eRLsKrw_6N', '75609893', ' Navratri Day 8  Celebrating Maa Mahagauri \r\n\r\nToday, we worship Maa Mahagauri, the symbol of purity, peace, and serenity. \r\n\r\nShe blesses her devotees with love, harmony, and liberation from negativity, guiding them towards a life filled with spiritual enlightenment and positivity. \r\n\r\n Offer coconut, white sweets, and milk-based dishes today to seek her divine blessings.\r\n\r\n Mantra: Om Devi Mahagauryai Namah\r\n\r\nMay Maa Mahagauri\'s divine light fill your heart with peace, prosperity, and happiness. \r\n\r\n#Navratri2025 #Day8 #MaaMahagauri #PeaceAndProsperity #FestivalOfFaith #SpiritualVibes #Shakti', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQF4FCIf1q69hA/feedshare-shrink_800/B56ZmZSP8KI4Ag-/0/1759213324728?e=1762992000&v=beta&t=LnDpezC_kYryNFZ02LbO6RidtWuqC6FM18kgIJ71tYI', 'urn:li:share:7378675508345044992', 'linkedin', 'API', 'c59bc3aa-1b4e-4a56-b817-50602b526c4d', 3, 1, 0, 0.6944444444444444, '58', '26', '2025-09-30', '1', '2025-10-09 09:52:56', '2025-10-22 09:26:24'),
(576, 'e5266555-8859-4f96-bab0-6596b9736d94', 'eRLsKrw_6N', '75609893', ' Navratri Day 7  Worshipping Maa Kaalratri \r\n\r\nToday, we honor Maa Kaalratri, the fierce and protective form of Maa Durga who destroys darkness and negativity. \r\n\r\nThough her form is fearsome, she is lovingly called Shubhankari, as she brings auspiciousness, blessings, and courage to her devotees. \r\n\r\n Offer jaggery or jaggery sweets to Maa Kaalratri today and seek her divine protection.\r\n\r\n Mantra: Om Devi Kaalratryai Namah \r\n\r\nMay her energy fill your life with fearlessness, peace, and strength. \r\n\r\n#Navratri2025 #Day7 #MaaKaalratri #PowerAndProtection #DestroyNegativity #FestivalOfFaith #SpiritualEnergy', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQG0dtWM1jiauw/feedshare-shrink_800/B56ZmOhUXFKAAg-/0/1759032723279?e=1762992000&v=beta&t=zPYhnvuqbZ7PVrlw8bHT735JsLXWVeWAk2rFcIvmfGI', 'urn:li:share:7377917991109394432', 'linkedin', 'API', 'd2b8fa35-867b-413b-a6a1-2d8ad7b11bc0', 4, 1, 0, 2.4456521739130435, '65', '28', '2025-09-28', '1', '2025-10-09 09:52:56', '2025-10-22 09:26:25'),
(577, 'e5266555-8859-4f96-bab0-6596b9736d94', 'eRLsKrw_6N', '75609893', ' Navratri Day 6  Celebrating Maa Katyayani \r\n\r\nToday, we worship Maa Katyayani, the fierce form of Goddess Durga, who blesses us with courage, strength, and protection. \r\n\r\nMay her divine energy remove all negativity and fill your life with peace, love, and victory over challenges. \r\n\r\n Offer yellow flowers and honey today to seek her blessings. \r\n\r\n Mantra: Om Devi Katyayanyai Namah\r\n\r\n Drop a  in the comments if you seek Maa Katyayanis courage and divine strength today! \r\n\r\n#Navratri2025 #Day6 #MaaKatyayani #CourageAndStrength #FestivalOfFaith #SpiritualVibes #NavratriVibes #DivineGrace', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQHI9_hhmDY2dA/feedshare-shrink_800/B56ZmJjKsEKMAg-/0/1758949324752?e=1762992000&v=beta&t=v_NkOKjmVEbK0ecWCul-O1MKkQX6UqE4DB7hmisU_Go', 'urn:li:share:7377568205457846272', 'linkedin', 'API', '1c15df8e-5b6f-43fe-b52a-e23eca9f5a50', 1, 1, 0, 3.7045454545454546, '29', '10', '2025-09-27', '1', '2025-10-09 09:52:56', '2025-10-22 09:26:20'),
(578, 'e5266555-8859-4f96-bab0-6596b9736d94', 'eRLsKrw_6N', '75609893', ' Navratri Day 5  Celebrating Maa Skandamata \r\n\r\nToday, we worship Maa Skandamata, the symbol of love, strength, and protection, who blesses her devotees with harmony and divine wisdom. \r\n\r\nMay her blessings fill your home with peace, prosperity, and happiness. \r\n\r\n Offer white flowers and bananas today to seek her grace. \r\n\r\n Mantra: Om Devi Skandamatayai Namah\r\n\r\n Drop a  if you seek Maa Skandamatas blessings for your family today! \r\n\r\n#Navratri2025 #Day5 #MaaSkandamata #DivineMother #FamilyBlessings #SpiritualVibes #FestivalOfFaith #NavratriVibes', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQHjQcsexGBm7A/feedshare-shrink_800/B56ZmEcy3gJoAg-/0/1758863766472?e=1762992000&v=beta&t=AguptK2kVpdzxoUS-7NCtDpbX3PpQ_6EFpAyEn4vPec', 'urn:li:share:7377209348424388608', 'linkedin', 'API', '16aedef6-2f62-4fac-a630-2366a1e163f4', 4, 1, 0, 1.2956989247311828, '60', '20', '2025-09-26', '1', '2025-10-09 09:52:56', '2025-10-22 09:26:26'),
(579, 'e5266555-8859-4f96-bab0-6596b9736d94', 'eRLsKrw_6N', '75609893', ' Navratri Day 4  Celebrating Maa Kushmanda \r\n\r\nToday, we worship Maa Kushmanda, the creator of the universe, who with her divine smile  filled the cosmos with warmth, light, and energy.\r\n\r\nMay her blessings bring health, prosperity, and positivity into your life. \r\n\r\n Offer pumpkin or malpua today to seek her divine grace.\r\n\r\n Mantra: Om Devi Kushmandayai Namah\r\n\r\n Lets embrace the power of creation and spread light wherever we go! \r\n\r\n#Navratri2025 #Day4 #MaaKushmanda #DivineBlessings #FestivalOfFaith #PositiveVibes #SpiritualJourney #NavratriVibes', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQERensigJ4QhA/feedshare-shrink_800/B56Zl_WKu.J8Ag-/0/1758778144486?e=1762992000&v=beta&t=zS3ZHG4pcWXcLufuROqaoKyw5YzXDatSysN69RyGrLs', 'urn:li:share:7376850215343083520', 'linkedin', 'API', '2c730356-784e-472e-89f9-6afc30e0de3c', 6, 1, 0, 1.5357843137254903, '94', '34', '2025-09-25', '1', '2025-10-09 09:52:57', '2025-10-22 09:26:27'),
(580, 'e5266555-8859-4f96-bab0-6596b9736d94', 'eRLsKrw_6N', '75609893', ' Navratri Day 3  Celebrating Maa Chandraghanta \r\n\r\nToday, we worship Maa Chandraghanta, the goddess of courage, serenity, and protection. \r\n\r\nShe teaches us to stay calm yet strong, even in the face of difficulties. May her blessings fill our lives with peace, harmony, and positivity. \r\n\r\n Offer kheer, milk, or white-colored sweets to seek her divine grace.\r\n\r\n Mantra: Om Devi Chandraghantayai Namah\r\n\r\n Which Navratri ritual do you enjoy the most? Share in the comments! \r\n\r\n#Navratri2025 #Day3 #MaaChandraghanta #StrengthAndPeace #DivineGrace #FestivalOfFaith #SpiritualJourney #NavratriVibes', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQEw-1DeO5ciqA/feedshare-shrink_1280/B56Zl6F8MBJ4As-/0/1758690002964?e=1762992000&v=beta&t=VYCmcUNZgR2af2WkpcYJw3E1UW42iwM4c8ShkOXI4AA', 'urn:li:share:7376480516033871873', 'linkedin', 'API', '1f5be2cf-7457-425e-9010-90cdc868c983', 3, 1, 0, 1.424966261808367, '78', '38', '2025-09-24', '1', '2025-10-09 09:52:57', '2025-10-22 09:26:27'),
(581, 'e5266555-8859-4f96-bab0-6596b9736d94', 'eRLsKrw_6N', '75609893', ' Navratri Day 2  Celebrating Maa Brahmacharini \r\n\r\nToday, we honor Maa Brahmacharini, the goddess of penance and devotion, who guides us on the path of truth and spiritual awakening. \r\n\r\nMay her blessings bring peace, inner strength, and clarity to your life. \r\n\r\n Chant her mantra: Om Devi Brahmacharinyai Namah\r\n\r\n Lets walk together on the path of devotion and wisdom this Navratri! \r\n\r\n#Navratri2025 #Day2 #MaaBrahmacharini #DivineGrace #IndianFestivals #SpiritualVibes #Blessings #NavratriVibes', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQEKJlBd9OUGTg/feedshare-shrink_800/B56Zl1Drn1I0Ag-/0/1758605526276?e=1762992000&v=beta&t=ZjQP3qYIt5eKKwdCsxL7Qz92hy6r4MaPHzivMfdXH84', 'urn:li:share:7376126191029669888', 'linkedin', 'API', '6a2be7eb-d359-4ab7-b8eb-18c7f73d8322', 4, 1, 0, 1.4224025974025973, '76', '32', '2025-09-23', '1', '2025-10-09 09:52:57', '2025-10-22 09:26:28'),
(582, 'e5266555-8859-4f96-bab0-6596b9736d94', 'eRLsKrw_6N', '75609893', ' Shubh Navratri 2025! \n\nToday marks the beginning of Navratri, a nine-day festival that celebrates the victory of good over evil, light over darkness, and positivity over negativity. \n\nEach day of Navratri is dedicated to one form of Goddess Durga, symbolizing strength, courage, wisdom, and prosperity. \n\nAs the dhols beat and the air fills with devotion, let\'s embrace these nine days with:\n Faith to overcome challenges,\n Gratitude for our blessings, and\n Compassion to uplift others.\n\nMay Maa Durga shower her divine blessings on you and your loved ones with happiness, success, and good health. \n\nLets celebrate the spirit of strength, faith, and victory of good over evil. \n\n Share your Navratri wishes or how you celebrate this festival with your family in the comments below!\n\n#Navratri2025 #ShubhNavratri #DurgaMaa #FestivalVibes #GoodOverEvil', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQF1SG3iRlROwQ/feedshare-shrink_800/B56ZlwHW.QH8Ag-/0/1758522602346?e=1762992000&v=beta&t=wlspJsJLbbjwt5F0_OAaE1B-Bir76-bIFldwo2rzJaQ', 'urn:li:share:7375778394694701056', 'linkedin', 'API', '95a0fac9-005f-471c-999a-dd7c3e62bfa1', 2, 0, 0, 2.5211426000899686, '66', '24', '2025-09-22', '1', '2025-10-09 09:52:57', '2025-10-22 09:26:28'),
(583, 'e5266555-8859-4f96-bab0-6596b9736d94', 'eRLsKrw_6N', '75609893', ' National Sports Day\r\n\r\nToday, we remember a true legend  Major Dhyan Chand, whose passion for hockey made India shine on the world stage. His dedication was so deep that he would practice even at night under the moonlight, which gave him the name Chand. \r\n\r\nFrom winning Olympic golds in 1928, 1932, and 1936, to inspiring generations with his discipline and humility, Major Dhyan Chands story is not just about sports  its about dreams, resilience, and national pride.\r\n\r\nOn this day, lets celebrate the spirit of sports that teaches us to work as a team, rise after every fall, and keep pushing forward with courage. \r\n\r\nHappy National Sports Day!\r\n\r\n#NationalSportsDay #MajorDhyanChand #PrideOfIndia #SportsSpirit #JaiHind', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQGvYuj_80Ix_A/feedshare-shrink_800/B56Zj1VmqpH8Ak-/0/1756462738725?e=1762992000&v=beta&t=7HE_nI6kGDts6S0VjRZdeEcPcEn7yDb5A9lrxnNEaJA', 'urn:li:share:7367138704718512128', 'linkedin', 'API', 'e58e06b1-7369-4850-8904-a33b7716540e', 4, 0, 0, 0.875, '98', '48', '2025-08-29', '1', '2025-10-09 09:52:57', '2025-10-22 09:26:29'),
(584, 'e5266555-8859-4f96-bab0-6596b9736d94', 'eRLsKrw_6N', '75609893', ' Celebrating Janmashtami 2025 \r\n\r\nToday, as we celebrate the birth of Lord Krishna, we are reminded of the timeless values He stood forwisdom, resilience, compassion, and the courage to choose what is right over what is easy.\r\n\r\nJanmashtami is not just a festival of devotion; its also an inspiration to bring balance in our livesbetween work and growth, success and humility, leadership and service. Just as Krishnas flute symbolizes harmony, may we all create workplaces and communities that thrive on collaboration, trust, and shared purpose.\r\n\r\n Wishing you and your loved ones a joyful Janmashtami filled with positivity, peace, and progress.\r\n\r\n#Janmashtami #Leadership #Inspiration #Celebration', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQE4kReOtTowBg/feedshare-shrink_2048_1536/B56ZixTaxwHQAo-/0/1755321314746?e=1762992000&v=beta&t=ciTUBN-a4vBe8wSxMVkTDhc4kstp-ngQ4-zFYnF_Rqg', 'urn:li:share:7362351211490000898', 'linkedin', 'API', 'a15b1e53-52a4-41cc-ab0c-ac250fb91ed5', 3, 0, 0, 0.6111111111111112, '76', '36', '2025-08-16', '1', '2025-10-09 09:52:57', '2025-10-22 09:26:29'),
(585, 'e5266555-8859-4f96-bab0-6596b9736d94', 'eRLsKrw_6N', '75609893', '  Happy Independence Day 2025!  \r\n\r\nToday, we celebrate 78 years of freedom  a journey built on sacrifice, courage, and unshakable determination. \r\n\r\n The green reminds us of growth, harmony, and progress.\r\n The white stands for peace, truth, and unity.\r\n The saffron inspires us with strength, courage, and resilience.\r\nAnd at the heart of it all, the Ashoka Chakra represents motion, reminding us that a nation moves forward only when its people move forward together. \r\n\r\nThis day is not just a reminder of our past, but a reflection of who we are today  innovators, dreamers, and changemakers determined to shape the India of tomorrow. \r\n\r\nLets honor this freedom by building, contributing, and standing united for a future that reflects the values of our tricolor.\r\n\r\n Jai Hind! \r\n\r\n#AzadiKaAmritMahotsav #IndependenceDay2025 #IndiaAt79 #HappyIndependenceDay #JaiHind #IndianIndependenceDay #IncredibleIndia #ProudIndian #IndependenceDayIndia #IndiaCelebrates #Tricolor #IndianFlag', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQF8To1eySetwA/feedshare-shrink_800/B56ZitmKX1G0Ag-/0/1755259120324?e=1762992000&v=beta&t=rz3ViJz_DlM2bbT1Ixcvg3DO1EylrErplYgxscD2LjE', 'urn:li:share:7362090350334656512', 'linkedin', 'API', 'ebeb74cb-8756-44fc-a365-c014a4700fd4', 2, 0, 0, 0.7083333333333333, '69', '31', '2025-08-15', '1', '2025-10-09 09:52:57', '2025-10-22 09:26:30'),
(632, 'e5266555-8859-4f96-bab0-6596b9736d94', 'eRLsKrw_6N', '75609893', ' On This Day  October 14 \r\n\r\nFrom acts of conviction to turning points in global power  todays history speaks to bravery, transformation, and the cost of change.\r\n\r\n In India, Dr. Ambedkars embrace of Buddhism remains a profound symbol: a man who gave his life to equality chose faith as a final act of truth.\r\n In England, the Battle of Hastings redefined a nations identity.\r\n For the world, the Cuban Missile Crisis reminded us how fragile peace can be.\r\n\r\nLet these moments inspire us  to act with integrity, to learn from the past, and to stand up for what matters.\r\n\r\n Which of these events resonates with you most  and why? Share your reflections below.\r\n\r\n#OnThisDay #October14 #Ambedkar #BattleOfHastings #CubanMissileCrisis #HistoryMatters #Legacy', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQGgzD6_PNlmvQ/feedshare-shrink_800/B56ZniMCARG4Ak-/0/1760436429690?e=1762992000&v=beta&t=JCSh8-RxCd-jDQgve05B2wHNph1inlvWu-olOVGlJ1M', 'urn:li:share:7383805559751434240', 'linkedin', 'API', 'c911db4a-b711-45f9-9270-27c94a3da57f', 3, 0, 0, 0.5214285714285715, '25', '11', '2025-10-14', '1', '2025-10-22 09:26:18', '2025-10-22 09:26:18'),
(688, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Today in History  October 24 \r\nA reminder that every great step forward begins with courage, connection, and collaboration.\r\n\r\n 1945  The United Nations Was Founded\r\nOut of the wreckage of war, the world chose unity over division. The UN became a beacon of hope  championing peace, human rights, and global cooperation.\r\n Lesson: Real progress begins when we decide to work together.\r\n\r\n 1861  The First Transcontinental Telegraph Was Completed\r\nThe world got smaller in an instant  messages could now cross America in seconds. It revolutionized communication and laid the foundation for our connected age.\r\n Lesson: Every innovation that connects us moves humanity forward.\r\n\r\n 1951  India Held Its First General Elections\r\nThe worlds largest democracy took its first breath of freedom through the ballot box. Over 170 million people were eligible to vote  a defining moment of trust, hope, and responsibility.\r\n Lesson: Democracy thrives when every voice counts.\r\n\r\n Todays Reflection:\r\nPeace , Connection , and Participation   these are the building blocks of a stronger world.\r\nHistory isnt behind us  its written in the choices we make today.\r\n\r\n#TodayInHistory #October24 #UNDay #Peace #Innovation #Democracy #India #Inspiration #Leadership', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQFczv_yTKqDqw/feedshare-shrink_1280/B56ZoU9jG7KAAs-/0/1761288270943?e=1762992000&v=beta&t=JD9HgCbq2KYexGcnWGUiqEKeyDnETNu0fGIIanVTHsY', 'urn:li:share:7387378451177041920', 'linkedin', 'API', 'dc6cd1c0-db3b-46b5-a490-5bf444777253', 1, 0, 0, 0.07692307692307693, '13', '5', '2025-10-24', '1', '2025-10-25 13:07:29', '2025-10-25 13:07:29'),
(689, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' On This Day  October 14 \r\n\r\nFrom acts of conviction to turning points in global power  todays history speaks to bravery, transformation, and the cost of change.\r\n\r\n In India, Dr. Ambedkars embrace of Buddhism remains a profound symbol: a man who gave his life to equality chose faith as a final act of truth.\r\n In England, the Battle of Hastings redefined a nations identity.\r\n For the world, the Cuban Missile Crisis reminded us how fragile peace can be.\r\n\r\nLet these moments inspire us  to act with integrity, to learn from the past, and to stand up for what matters.\r\n\r\n Which of these events resonates with you most  and why? Share your reflections below.\r\n\r\n#OnThisDay #October14 #Ambedkar #BattleOfHastings #CubanMissileCrisis #HistoryMatters #Legacy', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQGgzD6_PNlmvQ/feedshare-shrink_800/B56ZniMCARG4Ak-/0/1760436429690?e=1762992000&v=beta&t=JCSh8-RxCd-jDQgve05B2wHNph1inlvWu-olOVGlJ1M', 'urn:li:share:7383805559751434240', 'linkedin', 'API', 'cb0b2275-2091-4410-9ab1-c92f0d310ae7', 3, 4, 0, 0.7567226890756302, '45', '13', '2025-10-14', '1', '2025-10-25 13:07:30', '2025-10-25 13:07:30'),
(690, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri Day 6  Celebrating Maa Katyayani \r\n\r\nToday, we worship Maa Katyayani, the fierce form of Goddess Durga, who blesses us with courage, strength, and protection. \r\n\r\nMay her divine energy remove all negativity and fill your life with peace, love, and victory over challenges. \r\n\r\n Offer yellow flowers and honey today to seek her blessings. \r\n\r\n Mantra: Om Devi Katyayanyai Namah\r\n\r\n Drop a  in the comments if you seek Maa Katyayanis courage and divine strength today! \r\n\r\n#Navratri2025 #Day6 #MaaKatyayani #CourageAndStrength #FestivalOfFaith #SpiritualVibes #NavratriVibes #DivineGrace', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQHI9_hhmDY2dA/feedshare-shrink_800/B56ZmJjKsEKMAg-/0/1758949324752?e=1762992000&v=beta&t=v_NkOKjmVEbK0ecWCul-O1MKkQX6UqE4DB7hmisU_Go', 'urn:li:share:7377568205457846272', 'linkedin', 'API', 'e7c1e94b-eca5-49ae-84b6-ddd8bb8316d2', 1, 2, 0, 4.037878787878788, '34', '12', '2025-09-27', '1', '2025-10-25 13:07:31', '2025-10-25 13:07:31'),
(691, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Happy Dussehra! \r\n\r\nToday, we celebrate Dussehra, also known as Vijayadashami, a festival that marks the victory of good over evil, light over darkness, and truth over falsehood. \r\n\r\nThis day commemorates Lord Rama\'s victory over Ravana, symbolizing that no matter how powerful evil seems, truth and righteousness will always prevail. \r\n\r\nAcross India, vibrant celebrations unfold:\r\n Ramlila performances bringing the Ramayana to life,\r\n Effigies of Ravana, Meghnad, and Kumbhkaran set ablaze to signify the burning away of negativity,\r\n Families and communities coming together to celebrate unity and hope.\r\n\r\nAs we witness the flames rise high, lets also burn the Ravana within us  anger, ego, hatred, and greed  and welcome a life filled with kindness, humility, and compassion. \r\n\r\nDussehra reminds us that every challenge can be overcome with courage, faith, and perseverance.\r\nLet this day inspire you to take a step toward victory in your own life, whether personal or professional. \r\n\r\n What negativity are you ready to let go of this Dussehra? Share with us below!\r\n\r\n#HappyDussehra #Vijayadashami #GoodOverEvil #FestivalOfFaith #Positivity #Ramlila #DussehraCelebration', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQErk_8yPkJHDQ/feedshare-shrink_800/B56ZmjY1oKHQAk-/0/1759382822589?e=1762992000&v=beta&t=zK579tv99Rsmv10stnITsXkC_Yzt8qWfQwCLJD_puhM', 'urn:li:share:7379386415601676288', 'linkedin', 'API', 'a6be5d28-14c4-4188-9cc4-185266013c46', 4, 0, 0, 0.5166666666666666, '67', '31', '2025-10-02', '1', '2025-10-25 13:07:31', '2025-10-25 13:07:31'),
(692, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri 2025 Concludes with Gratitude \r\n\r\nAs these nine sacred nights come to a close, lets reflect on the divine blessings and lessons Maa Durga has bestowed upon us. \r\n\r\nMay the spirit of courage, devotion, and positivity guide us every day, helping us overcome challenges and embrace new beginnings. \r\n\r\n What was your most special Navratri moment this year? Share with us in the comments!\r\n\r\n#Navratri2025 #MaaDurgaBlessings #Gratitude #FestivalOfFaith #GoodOverEvil #SpiritualJourney #Positivity', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQFj9gv260MU1w/feedshare-shrink_1280/B56Zmerpz1IYAs-/0/1759303868687?e=1762992000&v=beta&t=ZBPyB49j-G91clM-Y5Dps7yTWpUzffOVJ9ptevCSnQY', 'urn:li:share:7379055255671640064', 'linkedin', 'API', '4752dd28-d035-4c22-8de7-745f8fe413e4', 5, 0, 0, 0.5905797101449275, '64', '25', '2025-10-01', '1', '2025-10-25 13:07:31', '2025-10-25 13:07:31'),
(693, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri Day 9  Celebrating Maa Siddhidatri \r\n\r\nOn the final day of Navratri, we bow to Maa Siddhidatri, the divine mother who blesses her devotees with spiritual wisdom and fulfillment. \r\n\r\nMay her grace remove ignorance and fill your life with clarity, peace, and prosperity. \r\n\r\n Offer fruits, sesame seeds, and sweets today to seek her divine blessings.\r\n\r\n Mantra: Om Devi Siddhidatryai Namah\r\n\r\n As Navratri concludes, may we carry forward the values of strength, faith, and devotion into our lives each day. \r\n\r\n#Navratri2025 #Day9 #MaaSiddhidatri #SpiritualGrowth #PeaceAndProsperity #FestivalOfFaith #NavratriVibes', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQHgqb3ZRsvAYA/feedshare-shrink_800/B56ZmeNpwoIAAg-/0/1759296004433?e=1762992000&v=beta&t=EaajXGGL4oWoI4UPtjdTn-PUkdSz_pJw2dLzHu-ZvOg', 'urn:li:share:7379022280321970176', 'linkedin', 'API', 'd06fd24a-8c7e-4970-8707-7dbd087b6c11', 12, 1, 0, 1.7303921568627452, '49', '21', '2025-10-01', '1', '2025-10-25 13:07:32', '2025-10-25 13:07:32'),
(694, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri Day 8  Celebrating Maa Mahagauri \r\n\r\nToday, we worship Maa Mahagauri, the symbol of purity, peace, and serenity. \r\n\r\nShe blesses her devotees with love, harmony, and liberation from negativity, guiding them towards a life filled with spiritual enlightenment and positivity. \r\n\r\n Offer coconut, white sweets, and milk-based dishes today to seek her divine blessings.\r\n\r\n Mantra: Om Devi Mahagauryai Namah\r\n\r\nMay Maa Mahagauri\'s divine light fill your heart with peace, prosperity, and happiness. \r\n\r\n#Navratri2025 #Day8 #MaaMahagauri #PeaceAndProsperity #FestivalOfFaith #SpiritualVibes #Shakti', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQF4FCIf1q69hA/feedshare-shrink_800/B56ZmZSP8KI4Ag-/0/1759213324728?e=1762992000&v=beta&t=LnDpezC_kYryNFZ02LbO6RidtWuqC6FM18kgIJ71tYI', 'urn:li:share:7378675508345044992', 'linkedin', 'API', 'fe872948-4de6-46ee-bbd8-d7bf966178a1', 3, 1, 0, 0.6944444444444444, '64', '29', '2025-09-30', '1', '2025-10-25 13:07:33', '2025-10-25 13:07:33'),
(695, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri Day 7  Worshipping Maa Kaalratri \r\n\r\nToday, we honor Maa Kaalratri, the fierce and protective form of Maa Durga who destroys darkness and negativity. \r\n\r\nThough her form is fearsome, she is lovingly called Shubhankari, as she brings auspiciousness, blessings, and courage to her devotees. \r\n\r\n Offer jaggery or jaggery sweets to Maa Kaalratri today and seek her divine protection.\r\n\r\n Mantra: Om Devi Kaalratryai Namah \r\n\r\nMay her energy fill your life with fearlessness, peace, and strength. \r\n\r\n#Navratri2025 #Day7 #MaaKaalratri #PowerAndProtection #DestroyNegativity #FestivalOfFaith #SpiritualEnergy', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQG0dtWM1jiauw/feedshare-shrink_800/B56ZmOhUXFKAAg-/0/1759032723279?e=1762992000&v=beta&t=zPYhnvuqbZ7PVrlw8bHT735JsLXWVeWAk2rFcIvmfGI', 'urn:li:share:7377917991109394432', 'linkedin', 'API', '651df5d0-a156-44dc-8a03-4e3ae11251d7', 4, 3, 0, 2.8456521739130434, '72', '32', '2025-09-28', '1', '2025-10-25 13:07:34', '2025-10-25 13:07:34'),
(696, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri Day 5  Celebrating Maa Skandamata \r\n\r\nToday, we worship Maa Skandamata, the symbol of love, strength, and protection, who blesses her devotees with harmony and divine wisdom. \r\n\r\nMay her blessings fill your home with peace, prosperity, and happiness. \r\n\r\n Offer white flowers and bananas today to seek her grace. \r\n\r\n Mantra: Om Devi Skandamatayai Namah\r\n\r\n Drop a  if you seek Maa Skandamatas blessings for your family today! \r\n\r\n#Navratri2025 #Day5 #MaaSkandamata #DivineMother #FamilyBlessings #SpiritualVibes #FestivalOfFaith #NavratriVibes', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQHjQcsexGBm7A/feedshare-shrink_800/B56ZmEcy3gJoAg-/0/1758863766472?e=1762992000&v=beta&t=AguptK2kVpdzxoUS-7NCtDpbX3PpQ_6EFpAyEn4vPec', 'urn:li:share:7377209348424388608', 'linkedin', 'API', 'c9ba63ad-a0f3-462e-8fcb-2d70160dec24', 4, 1, 0, 1.2956989247311828, '61', '21', '2025-09-26', '1', '2025-10-25 13:07:35', '2025-10-25 13:07:35'),
(697, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri Day 4  Celebrating Maa Kushmanda \r\n\r\nToday, we worship Maa Kushmanda, the creator of the universe, who with her divine smile  filled the cosmos with warmth, light, and energy.\r\n\r\nMay her blessings bring health, prosperity, and positivity into your life. \r\n\r\n Offer pumpkin or malpua today to seek her divine grace.\r\n\r\n Mantra: Om Devi Kushmandayai Namah\r\n\r\n Lets embrace the power of creation and spread light wherever we go! \r\n\r\n#Navratri2025 #Day4 #MaaKushmanda #DivineBlessings #FestivalOfFaith #PositiveVibes #SpiritualJourney #NavratriVibes', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQERensigJ4QhA/feedshare-shrink_800/B56Zl_WKu.J8Ag-/0/1758778144486?e=1762992000&v=beta&t=zS3ZHG4pcWXcLufuROqaoKyw5YzXDatSysN69RyGrLs', 'urn:li:share:7376850215343083520', 'linkedin', 'API', '708c5aba-1517-4581-9ec5-521dc98f44bb', 6, 1, 0, 1.5357843137254903, '96', '35', '2025-09-25', '1', '2025-10-25 13:07:36', '2025-10-25 13:07:36'),
(698, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri Day 3  Celebrating Maa Chandraghanta \r\n\r\nToday, we worship Maa Chandraghanta, the goddess of courage, serenity, and protection. \r\n\r\nShe teaches us to stay calm yet strong, even in the face of difficulties. May her blessings fill our lives with peace, harmony, and positivity. \r\n\r\n Offer kheer, milk, or white-colored sweets to seek her divine grace.\r\n\r\n Mantra: Om Devi Chandraghantayai Namah\r\n\r\n Which Navratri ritual do you enjoy the most? Share in the comments! \r\n\r\n#Navratri2025 #Day3 #MaaChandraghanta #StrengthAndPeace #DivineGrace #FestivalOfFaith #SpiritualJourney #NavratriVibes', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQEw-1DeO5ciqA/feedshare-shrink_1280/B56Zl6F8MBJ4As-/0/1758690002964?e=1762992000&v=beta&t=VYCmcUNZgR2af2WkpcYJw3E1UW42iwM4c8ShkOXI4AA', 'urn:li:share:7376480516033871873', 'linkedin', 'API', '8ecabe20-00dd-4ab4-a370-c9aad7727571', 3, 1, 0, 1.424966261808367, '78', '38', '2025-09-24', '1', '2025-10-25 13:07:37', '2025-10-25 13:07:37'),
(699, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Navratri Day 2  Celebrating Maa Brahmacharini \r\n\r\nToday, we honor Maa Brahmacharini, the goddess of penance and devotion, who guides us on the path of truth and spiritual awakening. \r\n\r\nMay her blessings bring peace, inner strength, and clarity to your life. \r\n\r\n Chant her mantra: Om Devi Brahmacharinyai Namah\r\n\r\n Lets walk together on the path of devotion and wisdom this Navratri! \r\n\r\n#Navratri2025 #Day2 #MaaBrahmacharini #DivineGrace #IndianFestivals #SpiritualVibes #Blessings #NavratriVibes', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQEKJlBd9OUGTg/feedshare-shrink_800/B56Zl1Drn1I0Ag-/0/1758605526276?e=1762992000&v=beta&t=ZjQP3qYIt5eKKwdCsxL7Qz92hy6r4MaPHzivMfdXH84', 'urn:li:share:7376126191029669888', 'linkedin', 'API', '2688d260-360a-470a-b309-5e6c36d18252', 4, 1, 0, 1.4224025974025973, '76', '32', '2025-09-23', '1', '2025-10-25 13:07:38', '2025-10-25 13:07:38'),
(700, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Shubh Navratri 2025! \n\nToday marks the beginning of Navratri, a nine-day festival that celebrates the victory of good over evil, light over darkness, and positivity over negativity. \n\nEach day of Navratri is dedicated to one form of Goddess Durga, symbolizing strength, courage, wisdom, and prosperity. \n\nAs the dhols beat and the air fills with devotion, let\'s embrace these nine days with:\n Faith to overcome challenges,\n Gratitude for our blessings, and\n Compassion to uplift others.\n\nMay Maa Durga shower her divine blessings on you and your loved ones with happiness, success, and good health. \n\nLets celebrate the spirit of strength, faith, and victory of good over evil. \n\n Share your Navratri wishes or how you celebrate this festival with your family in the comments below!\n\n#Navratri2025 #ShubhNavratri #DurgaMaa #FestivalVibes #GoodOverEvil', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQF1SG3iRlROwQ/feedshare-shrink_800/B56ZlwHW.QH8Ag-/0/1758522602346?e=1762992000&v=beta&t=wlspJsJLbbjwt5F0_OAaE1B-Bir76-bIFldwo2rzJaQ', 'urn:li:share:7375778394694701056', 'linkedin', 'API', '7660afb7-a646-4b03-a2b7-8a9551ddcdac', 2, 0, 0, 2.5211426000899686, '66', '24', '2025-09-22', '1', '2025-10-25 13:07:39', '2025-10-25 13:07:39'),
(701, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' National Sports Day\r\n\r\nToday, we remember a true legend  Major Dhyan Chand, whose passion for hockey made India shine on the world stage. His dedication was so deep that he would practice even at night under the moonlight, which gave him the name Chand. \r\n\r\nFrom winning Olympic golds in 1928, 1932, and 1936, to inspiring generations with his discipline and humility, Major Dhyan Chands story is not just about sports  its about dreams, resilience, and national pride.\r\n\r\nOn this day, lets celebrate the spirit of sports that teaches us to work as a team, rise after every fall, and keep pushing forward with courage. \r\n\r\nHappy National Sports Day!\r\n\r\n#NationalSportsDay #MajorDhyanChand #PrideOfIndia #SportsSpirit #JaiHind', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQGvYuj_80Ix_A/feedshare-shrink_800/B56Zj1VmqpH8Ak-/0/1756462738725?e=1762992000&v=beta&t=7HE_nI6kGDts6S0VjRZdeEcPcEn7yDb5A9lrxnNEaJA', 'urn:li:share:7367138704718512128', 'linkedin', 'API', 'd67a7f2e-817c-43ae-929d-d888c7e9a41f', 4, 0, 0, 0.875, '98', '48', '2025-08-29', '1', '2025-10-25 13:07:39', '2025-10-25 13:07:39'),
(702, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', ' Celebrating Janmashtami 2025 \r\n\r\nToday, as we celebrate the birth of Lord Krishna, we are reminded of the timeless values He stood forwisdom, resilience, compassion, and the courage to choose what is right over what is easy.\r\n\r\nJanmashtami is not just a festival of devotion; its also an inspiration to bring balance in our livesbetween work and growth, success and humility, leadership and service. Just as Krishnas flute symbolizes harmony, may we all create workplaces and communities that thrive on collaboration, trust, and shared purpose.\r\n\r\n Wishing you and your loved ones a joyful Janmashtami filled with positivity, peace, and progress.\r\n\r\n#Janmashtami #Leadership #Inspiration #Celebration', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQE4kReOtTowBg/feedshare-shrink_2048_1536/B56ZixTaxwHQAo-/0/1755321314746?e=1762992000&v=beta&t=ciTUBN-a4vBe8wSxMVkTDhc4kstp-ngQ4-zFYnF_Rqg', 'urn:li:share:7362351211490000898', 'linkedin', 'API', 'a0f92cda-c697-4de0-b19a-968725f5fb40', 3, 0, 0, 0.6111111111111112, '76', '36', '2025-08-16', '1', '2025-10-25 13:07:40', '2025-10-25 13:07:40'),
(703, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '75609893', '  Happy Independence Day 2025!  \r\n\r\nToday, we celebrate 78 years of freedom  a journey built on sacrifice, courage, and unshakable determination. \r\n\r\n The green reminds us of growth, harmony, and progress.\r\n The white stands for peace, truth, and unity.\r\n The saffron inspires us with strength, courage, and resilience.\r\nAnd at the heart of it all, the Ashoka Chakra represents motion, reminding us that a nation moves forward only when its people move forward together. \r\n\r\nThis day is not just a reminder of our past, but a reflection of who we are today  innovators, dreamers, and changemakers determined to shape the India of tomorrow. \r\n\r\nLets honor this freedom by building, contributing, and standing united for a future that reflects the values of our tricolor.\r\n\r\n Jai Hind! \r\n\r\n#AzadiKaAmritMahotsav #IndependenceDay2025 #IndiaAt79 #HappyIndependenceDay #JaiHind #IndianIndependenceDay #IncredibleIndia #ProudIndian #IndependenceDayIndia #IndiaCelebrates #Tricolor #IndianFlag', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQF8To1eySetwA/feedshare-shrink_800/B56ZitmKX1G0Ag-/0/1755259120324?e=1762992000&v=beta&t=rz3ViJz_DlM2bbT1Ixcvg3DO1EylrErplYgxscD2LjE', 'urn:li:share:7362090350334656512', 'linkedin', 'API', '19d1f062-39c5-4c52-b521-6c9c37613237', 2, 0, 0, 0.7083333333333333, '69', '31', '2025-08-15', '1', '2025-10-25 13:07:40', '2025-10-25 13:07:40'),
(704, 'b4206492-1778-4860-8e24-af93296a37d4', 'vJUiGhJ_Dk', '106470960', ' On This Day  October 14 \r\n\r\nFrom acts of conviction to turning points in global power  todays history speaks to bravery, transformation, and the cost of change.\r\n\r\n In India, Dr. Ambedkars embrace of Buddhism remains a profound symbol: a man who gave his life to equality chose faith as a final act of truth.\r\n In England, the Battle of Hastings redefined a nations identity.\r\n For the world, the Cuban Missile Crisis reminded us how fragile peace can be.\r\n\r\nLet these moments inspire us  to act with integrity, to learn from the past, and to stand up for what matters.\r\n\r\n Which of these events resonates with you most  and why? Share your reflections below.\r\n\r\n#OnThisDay #October14 #Ambedkar #BattleOfHastings #CubanMissileCrisis #HistoryMatters #Legacy', NULL, 'https://media.licdn.com/dms/image/v2/D5622AQE-OaQPCtt0GA/feedshare-shrink_800/B56Znh3gguHkAk-/0/1760431049704?e=1762992000&v=beta&t=ozHWGOPalOH078cFClLcBRyfqQnh-mts-Q8hiaCM6Ls', 'urn:li:share:7383783006605344768', 'linkedin', 'API', '5fb5eaa3-ae3e-41eb-b6a2-f16723564ff8', 1, 0, 0, 2.6666666666666665, '9', '3', '2025-10-14', '1', '2025-10-25 13:07:41', '2025-10-25 13:07:41'),
(795, 'b4206492-1778-4860-8e24-af93296a37d4', '2479778642411729', '621976714336919', ' On This Day  October 14 \n\nFrom acts of conviction to turning points in global power  todays history speaks to bravery, transformation, and the cost of change.\n\n In India, Dr. Ambedkars embrace of Buddhism remains a profound symbol: a man who gave his life to equality chose faith as a final act of truth.\n In England, the Battle of Hastings redefined a nations identity.\n For the world, the Cuban Missile Crisis reminded us how fragile peace can be.\n\nLet these moments inspire us  to act with integrity, to learn from the past, and to stand up for what matters.\n\n Which of these events resonates with you most  and why? Share your reflections below.\n\n#OnThisDay #October14 #Ambedkar #BattleOfHastings #CubanMissileCrisis #HistoryMatters #Legacy', NULL, 'https://scontent.fpnq13-2.fna.fbcdn.net/v/t39.30808-6/560778756_122150213438863485_1818968641910314943_n.jpg?stp=dst-jpg_s720x720_tt6&_nc_cat=101&ccb=1-7&_nc_sid=127cfc&_nc_ohc=1hUTcKSCldUQ7kNvwGIu4P9&_nc_oc=AdlpraKVCR-4r4ou0qVDD35DYn0bvftsAyGIRVOxy93mJaRKL2GLGaLLQSIECPhG6UJfe1DbuIjcAfTy7As7meXY&_nc_zt=23&_nc_ht=scontent.fpnq13-2.fna&edm=AKIiGfEEAAAA&_nc_gid=DqNll88PdWVau7vWLUnj8A&_nc_tpa=Q5bMBQGUX8oF7OuEbbqM4GQuRfkUoCBwFB65wVEX6-XGrEhSgh6IXDbs8j7oDv7WwR6AQA_bxGuksqT1nQ&oh=00_AffpzpPAzyFHzLZohVbNKhdDpLvwVAK8ba99MA389SAzTg&oe=69053973', '621976714336919_122150213462863485', 'facebook', 'API', '9e3e6e9e-3545-4e8f-8c46-28e976a1f695', 0, 0, 0, 0, '2', '1', '2025-10-14', '1', '2025-10-27 11:09:24', '2025-10-27 11:09:24'),
(796, 'b4206492-1778-4860-8e24-af93296a37d4', '2479778642411729', '631102136744766', ' On This Day  October 14 \n\nFrom acts of conviction to turning points in global power  todays history speaks to bravery, transformation, and the cost of change.\n\n In India, Dr. Ambedkars embrace of Buddhism remains a profound symbol: a man who gave his life to equality chose faith as a final act of truth.\n In England, the Battle of Hastings redefined a nations identity.\n For the world, the Cuban Missile Crisis reminded us how fragile peace can be.\n\nLet these moments inspire us  to act with integrity, to learn from the past, and to stand up for what matters.\n\n Which of these events resonates with you most  and why? Share your reflections below.\n\n#OnThisDay #October14 #Ambedkar #BattleOfHastings #CubanMissileCrisis #HistoryMatters #Legacy', NULL, 'https://scontent.fpnq13-1.fna.fbcdn.net/v/t39.30808-6/560439025_122159894960791773_381493391828801064_n.jpg?stp=dst-jpg_s720x720_tt6&_nc_cat=109&ccb=1-7&_nc_sid=127cfc&_nc_ohc=OCCLHsL0gtEQ7kNvwFyu4Bg&_nc_oc=AdkwTOvDOyh23gWJg0RDfLYPRbfGQJp8yt6w4HsI5Mm0Weft4FwtFAvtNXCYrNhJ-SiVj9WgMugdMjD3JoYUMCdG&_nc_zt=23&_nc_ht=scontent.fpnq13-1.fna&edm=AKIiGfEEAAAA&_nc_gid=xoLb1Lc8P90Zb-Zeg3e9SA&_nc_tpa=Q5bMBQHyZ3AziNZNIQZI1L7fk06bNRnIYWbxGCVpukov620INM2GMfYeSWnCvhaePulnMuHlE1DdE-hGwA&oh=00_Afdg4fKdHwzw70N0pbVTKKL32pFTPR3styIte761lmbvfQ&oe=69052D7B', '631102136744766_122159895062791773', 'facebook', 'API', '3abf249c-fb66-4e2f-ac45-73479c8adf5c', 2, 6, 0, 5, '19', '19', '2025-10-14', '1', '2025-10-27 11:09:27', '2025-11-08 12:39:13'),
(797, 'b4206492-1778-4860-8e24-af93296a37d4', '2479778642411729', '631102136744766', ' Happy Dussehra! \n\nToday, we celebrate Dussehra, also known as Vijayadashami, a festival that marks the victory of good over evil, light over darkness, and truth over falsehood. \n\nThis day commemorates Lord Rama\'s victory over Ravana, symbolizing that no matter how powerful evil seems, truth and righteousness will always prevail. \n\nAcross India, vibrant celebrations unfold:\n Ramlila performances bringing the Ramayana to life,\n Effigies of Ravana, Meghnad, and Kumbhkaran set ablaze to signify the burning away of negativity,\n Families and communities coming together to celebrate unity and hope.\n\nAs we witness the flames rise high, lets also burn the Ravana within us  anger, ego, hatred, and greed  and welcome a life filled with kindness, humility, and compassion. \n\nDussehra reminds us that every challenge can be overcome with courage, faith, and perseverance.\nLet this day inspire you to take a step toward victory in your own life, whether personal or professional. \n\n What negativity are you ready to let go of this Dussehra? Share with us below in comments!\n\n#HappyDussehra #Vijayadashami #GoodOverEvil #FestivalOfFaith #Positivity #Ramlila #DussehraCelebration', NULL, 'https://scontent.fpnq13-2.fna.fbcdn.net/v/t39.30808-6/559035848_122158279370791773_927274107086212452_n.jpg?stp=dst-jpg_s720x720_tt6&_nc_cat=111&ccb=1-7&_nc_sid=127cfc&_nc_ohc=U5_X9PcEunUQ7kNvwESVCin&_nc_oc=AdnmsBdT8HnT14RS7iwPqs3Ivrpd9-bv2rs8IRaQNkMedv3GptwfCbGjEFN1451eFlpQEWay1LUcfq2HD1PndvZp&_nc_zt=23&_nc_ht=scontent.fpnq13-2.fna&edm=AKIiGfEEAAAA&_nc_gid=xoLb1Lc8P90Zb-Zeg3e9SA&_nc_tpa=Q5bMBQHMC8du-Pf12rKyxrmBGEgcl7QPymsDfN1X99JszOdQ2Pb6AdL0Vb3oqVff5_M9EH0L1TNWAzDtew&oh=00_AffFBV_kA_bvWKB8XA5w3PKU8syaMTX5Ls0c43dj5lVbAw&oe=690532AA', '631102136744766_122158279538791773', 'facebook', 'API', 'fd76397b-6d08-447d-853d-032c87bc979a', 4, 3, 0, 3.5, '24', '6', '2025-10-02', '1', '2025-10-27 11:09:30', '2025-11-07 07:15:39'),
(798, 'b4206492-1778-4860-8e24-af93296a37d4', '2479778642411729', '631102136744766', ' September 22: A Day of Reflection & Progress\n\nFrom Indias remarkable achievements in space exploration  and wildlife conservation  to the ongoing global quest for peace , today carries powerful messages of courage, innovation, and hope.\n\n Indias milestones:\n Birth anniversary of V.K. Krishna Menon, a stalwart of Indian diplomacy.\n Celebrating Chandrayaan-2 orbiters success, a proud moment for ISRO and Indias space journey.\n World Rhino Day  honoring Indias majestic one-horned rhinos and spreading awareness about wildlife conservation.\n\n Global reflections:\n Marking the International Day of Peace and remembering pivotal moments like the Baltic states joining the UN.\n\n What does peace and progress mean to you today? Share your thoughts below!\n\n#OnThisDay #IndianHistory #WorldPeaceDay #Chandrayaan2 #WildlifeConservation #ISRO #September22', NULL, 'https://scontent.fpnq13-6.fna.fbcdn.net/v/t39.30808-6/550684737_122156990792791773_5519457644383867084_n.jpg?_nc_cat=102&ccb=1-7&_nc_sid=127cfc&_nc_ohc=0z6F9jEgcVsQ7kNvwHgHlWW&_nc_oc=Adm9YLjOwfNrGNHGxEWuhSFea7ePrJod34Y_0dyB-pznneY3aygHUFSqkuh_hQ6hFbnuMs7MIBAPgIU9XtYPby75&_nc_zt=23&_nc_ht=scontent.fpnq13-6.fna&edm=AKIiGfEEAAAA&_nc_gid=xoLb1Lc8P90Zb-Zeg3e9SA&_nc_tpa=Q5bMBQFTjVLfd0e8AKtmLBd6Es-5VTvVN7yXRoRkscya8cXq353DQtvvVeQQQQVEraeZdavTFWEBeFuPUw&oh=00_AfckxzBxArRCDbWpYqCVHpZ4yHfawk2eKSTxySg1NbEnxA&oe=69053998', '631102136744766_122156990918791773', 'facebook', 'API', '19cdd631-b3eb-4f27-957d-f6c65654c2b4', 2, 3, 0, 2.5, '25', '5', '2025-09-22', '1', '2025-10-27 11:09:35', '2025-11-07 08:16:36'),
(799, 'b4206492-1778-4860-8e24-af93296a37d4', '2479778642411729', '631102136744766', ' This Week in Web Dev: The Power of Performance & AI\n\nThis week, the tech world is buzzing with new releases and paradigm shifts. Its a great time to reflect on the core principles that continue to shape the industry, from speed to user experience.\n\nSeptember 16: A major browser update from Google focused on improving Core Web Vitals, reinforcing that performance is no longer a luxuryits a necessity for good SEO and a great user experience.\n\nSeptember 18: The release of a new AI-powered code generator thats not just a tool, but a true assistant, hinting at a future where developers can focus more on logic and less on boilerplate code.\n\nSeptember 20: A significant leap in serverless functions, with new frameworks making it easier than ever to build highly scalable, cost-effective applications without the headache of managing servers.\n\nToday: A landmark new study reveals that micro-frontends are becoming the standard for large-scale, complex applications, allowing teams to work independently and ship faster.\n\n Whats the most exciting development youve seen this week? Tell us how it\'s changing the way you build.\n\n#WebDev #WebDevelopment #Developer #AI #Frontend #Backend #Coding #TechTrends #CoreWebVitals #Serverless', NULL, 'https://scontent.fpnq13-3.fna.fbcdn.net/v/t39.30808-6/550404603_122156750978791773_4600891675627455970_n.jpg?stp=dst-jpg_s720x720_tt6&_nc_cat=100&ccb=1-7&_nc_sid=127cfc&_nc_ohc=oKf6zkovV5MQ7kNvwHBIZk3&_nc_oc=AdlaB-9NggT8wN1X1gT66ZE7yb5wkB01SkOXDbINEfQsz_NWAUhjZgfuls-iRAbs0NqdSgfgEPFvdUsgyiI_8FtB&_nc_zt=23&_nc_ht=scontent.fpnq13-3.fna&edm=AKIiGfEEAAAA&_nc_gid=xoLb1Lc8P90Zb-Zeg3e9SA&_nc_tpa=Q5bMBQEUFEJwXFu93fGhxphlJZqTnmKxO-X4So9Yh4syqMSHmVcj3HvL89XVHcxZFsF5sGHH-f_i-4QyfQ&oh=00_AfeueZlix-Wdd28XCB9_ssrXa021u44ypDR3asJBdYDUzg&oe=69051059', '631102136744766_122156751110791773', 'facebook', 'API', '8db454d2-7c2c-482c-944a-7d6c4d725d78', 2, 5, 0, 3.5, '25'