(800, 'b4206492-1778-4860-8e24-af93296a37d4', '2479778642411729', '631102136744766', ' On This Day  September 18\nMoments That Shaped India\n\n 1803: British forces captured Puri, one of Hinduisms four sacred Dhams.\n\n 1948: Operation Polo ended, integrating Hyderabad into the Indian Union.\n\n 2016: The Uri attack claimed the lives of 19 brave soldiers.\n\n\"History teaches us lessons every day.\nWhich of these events speaks to you the most?\"\n Share your thoughts below!\n\n#HistoryMatters #September18 #OnThisDay', NULL, 'https://scontent.fpnq13-4.fna.fbcdn.net/v/t39.30808-6/548529545_122156448254791773_7805714351668993925_n.jpg?_nc_cat=108&ccb=1-7&_nc_sid=127cfc&_nc_ohc=D_chQA0eK9gQ7kNvwEw6ib5&_nc_oc=AdlAYwy-FLBadii5NJgm2c0giIo-rpPkn_pfb5RveTINp7zwaL7rGJMlm1P9QtXSG-8y2TaHLJZFU5Z9XvUVGGqp&_nc_zt=23&_nc_ht=scontent.fpnq13-4.fna&edm=AKIiGfEEAAAA&_nc_gid=xoLb1Lc8P90Zb-Zeg3e9SA&_nc_tpa=Q5bMBQFOrfEcngtZlpxw6auShTR85P6DBuZayO688iLNYUaEQcLqvk_pE9Ml9MjPS9KpFvlq6Z9I7Z_WjQ&oh=00_AffcygMr-f1MKfL8c2LAZrkzkKZEMELzbIvCXCAV9kt6cA&oe=69053C98', '631102136744766_122156448368791773', 'facebook', 'API', 'c2878a64-4ffb-4e9e-ae82-89c8d89beb66', 3, 0, 0, 3, '25', '8', '2025-09-18', '1', '2025-10-27 11:09:42', '2025-10-27 11:09:42');
