(801, 'b4206492-1778-4860-8e24-af93296a37d4', '2479778642411729', '631102136744766', ' September 17: Today in History\n\nToday is packed with importanceboth for India and the world.\n\n In India:\n Today marks Hyderabad Liberation Day, when the historic Nizam-ruled Hyderabad officially joined the Indian Union in 1948 through Operation Polo.\n In Maharashtra, we also remember Marathwada Liberation Day, celebrating the same liberation.\n Its Vishwakarma Pujaa day of reverence for the artisans, engineers, craftsmen, and the tools and machines that make our world build and function.\n\n Around the world:\n World Patient Safety Day reminds us of healthcare safety, preventing harm and making systems more reliable.\n The United States marks Constitution Day & Citizenship Day, commemorating the signing of the U.S. Constitution in 1787.\n And in 1978, the Camp David Accords were signedan emblem of peace diplomacy between Egypt and Israel.\n\nWhat inspires you most from these momentsliberation, craftsmanship, peace, safety, or constitution building? Share your thoughts below. \n\n#OnThisDay #HyderabadLiberation #VishwakarmaPuja #PatientSafety #Peace #History', NULL, 'https://scontent.fpnq13-3.fna.fbcdn.net/v/t39.30808-6/548209869_122156350826791773_1990384476005441655_n.jpg?_nc_cat=100&ccb=1-7&_nc_sid=127cfc&_nc_ohc=Inlbqm7MDOQQ7kNvwHWjrHk&_nc_oc=Adl2pJ93ViGHfmC5rXDchdRvLdQ-sTcdpt8LBUsweSUfzlvD4kFYo4UrJk5Du1P05kc4jNicEl8mGkL9RCgV8B8m&_nc_zt=23&_nc_ht=scontent.fpnq13-3.fna&edm=AKIiGfEEAAAA&_nc_gid=xoLb1Lc8P90Zb-Zeg3e9SA&_nc_tpa=Q5bMBQHTK_3ZEuR-1uTWH64CUYbYlNlXi07XI2txv6tYYgG6894dhdWxbzohhigt5XuldOa251zaKCL_OA&oh=00_AfeeXfmCYPVoDhbYbXEbjuLzbqsBWcDS9tT4bgJJuWNYvw&oe=69052280', '631102136744766_122156350940791773', 'facebook', 'API', '582a2614-44f7-47e0-b60d-18b2e9f610e0', 3, 0, 0, 3, '18', '7', '2025-09-17', '1', '2025-10-27 11:09:45', '2025-10-27 11:09:45'),
(802, 'b4206492-1778-4860-8e24-af93296a37d4', '2479778642411729', '631102136744766', ' September 9: A Day of Transformative Moments\n\nThroughout history, September 9 has been marked by landmark decisions, the rise and fall of leaders, and cultural milestones. \n\nFrom the naming of the United States , to dramatic wartime events , and the record-breaking reign of Queen Elizabeth II , this date has shaped the world in remarkable ways.\n\nToday, we also pause to honor the courage and dedication of emergency service personnel  on Emergency Services Day (UK). \n\n Engage with us!\nWhich event from history on this day fascinates you the most, and why? Share your thoughts in the comments below! \n\n#OnThisDay #HistoricalMoments #September9 #Legacy #HistoryMatters', NULL, 'https://scontent.fpnq13-6.fna.fbcdn.net/v/t39.30808-6/545162665_122155175792791773_6095332244075712408_n.jpg?stp=dst-jpg_p720x720_tt6&_nc_cat=102&ccb=1-7&_nc_sid=127cfc&_nc_ohc=2Bl0T6Boo4UQ7kNvwFPOYIE&_nc_oc=AdlrAYnlp6f4kpEvshEAjnbceLUCrVwPjqLlCmiVCX7GqcDI1OIFik_m6790QFsgtg0MX_ND0PlmrIid8qptg7wI&_nc_zt=23&_nc_ht=scontent.fpnq13-6.fna&edm=AKIiGfEEAAAA&_nc_gid=xoLb1Lc8P90Zb-Zeg3e9SA&_nc_tpa=Q5bMBQHf6orXVEarIzKu_NBjhbvHLYrXyoABZrFR17eJ9Ep9TvOXIhoBNgTjdQVY95x0c0kM6axuKApN8A&oh=00_AffXozeojvuS4hWs6sZDj_UmHD7D07-ZIgvMKpZemN2TCw&oe=69053519', '631102136744766_122155175822791773', 'facebook', 'API', '04116979-fa34-42d1-8ffe-8997a8d4b94e', 2, 0, 0, 2, '26', '11', '2025-09-09', '1', '2025-10-27 11:09:49', '2025-10-27 11:09:49'),
